window.bookSummaryJSON = "<p><b>Heretic. Heathen.&nbsp;</b><b><i>Demon.</i></b></p> <p>The company war between the Valiant Dreamers and the Iron Champions continues. But these Human matters don't matter to Salvos. She takes off to with her companions to the Plaguelands, in hopes to level from the undead, speak with Kobolds, and maybe befriend a Lich!</p> <p>...The last bit may be a little bit difficult. But she is Salvos. She will not give up so easily. She will evolve. She will fight with her companions. And she will grow&nbsp;<i>stronger.</i></p>"; 
